# -*- coding: utf-8 -*-

class Solution(object):

    def validPalindrome(self, s: str) -> bool:
        if s == s[::-1]:
            return True
        i, j = 0, len(s)-1
        while i < j:
            if s[i] == s[j]:
                i += 1
                j -= 1
            else:
                return self.substringValid(s[i+1:j+1]) or self.substringValid(s[i:j])
        return True

    def substringValid(self, s):
        i, j = 0, len(s)-1
        while i < j:
            if s[i] != s[j]:
                return False
            i += 1
            j -= 1
        return True


def main():
    # s = 'aba'
    s = 'eeccccbebaeeabebccceea'
    # s = ''
    result = Solution().validPalindrome(s=s)
    print(result)


if __name__ == '__main__':
    main()
